import React, { useEffect } from 'react';
import './index.css';

function App() {
  useEffect(() => {
    const observer = new IntersectionObserver(
      (entries) => {
        entries.forEach((entry) => {
          if (entry.isIntersecting) {
            entry.target.classList.add('visible');
          } else {
            entry.target.classList.remove('visible');
          }
        });
      },
      { threshold: 0.2 } // Запускаем анимацию, когда блок виден на 20%
    );

    document.querySelectorAll('.hidden').forEach((section) => {
      observer.observe(section);
    });

    return () => observer.disconnect();
  }, []);

  function scrollToSection(id) {
    document.getElementById(id).scrollIntoView({ behavior: 'smooth' });
  }

  return (
    <div className="App">
      <header className="hero">
        <div className="hero-content">
          <h1>Боты, которые оживают в диалоге</h1>
          <p>Искусственный интеллект, который адаптируется, учится и взаимодействует с вами, как настоящий собеседник.</p>
        </div>
      </header>

      <div className='buttons'>
        <button onClick={() => scrollToSection('about')}>Узнать больше</button>
        <button onClick={() => scrollToSection('price')}>Прайс</button>
        <button className="yellow-outline" onClick={() => window.location.href = 'https://t.me/BeregFirst'}>Сделать заказ</button>
        <button className="red-outline" onClick={() => window.location.href = 'https://t.me/TechinalSupp0rt'}>Тех. поддержка</button>
      </div>

      <section id="about" className="hidden">
        <h2>О наших ботах</h2>
        <div className="features">
          <div className="feature-card">Отвечать на вопросы и вести диалоги</div>
          <div className="feature-card">Запоминать информацию и использовать её в беседе</div>
          <div className="feature-card">Генерировать уникальные тексты и сценарии</div>
          <div className="feature-card">Создавать изображения по запросу</div>
          <div className="feature-card">Играть в текстовые RPG</div>
        </div>
      </section>

      <section id="price" className="hidden price-section">
        <h2>💰 Тарифы</h2>
        <div className="price-card">1. Базовый бот — от 100 до 300 рублей</div>
        <div className="price-card">2. Бот со средним функционалом — от 300 до 500 рублей</div>
        <div className="price-card">3. Бот со сложным функционалом — от 500 до ∞</div>
        <div className="price-card">📌 Поддержка работы бота — 50 рублей в месяц</div>
      </section>
    </div>
  );
}

export default App;
